<!DOCTYPE html>
<html lang="en-US">
<head>
<meta charset="UTF-8">
<meta name="author" content="Jenna Sloan">
<title>Fez Font Comparer 2</title>
<meta name="viewport" content="width=device-width, initial-scale=1" />
<style>
:root{
	--tbodyborder: 7px inset black;
	--tbodyinnerheavyborder: 4px ridge #BBB;
	--tbodyinnerlightborder: 2px ridge lightskyblue;
}
#checkboxlists>div {
	display: inline-block;
	vertical-align: top;
	border: 1px solid black;
	padding: 0.5ex;
	font-size: 16px;
}
table{
	margin: 2px;
	outline: 2px outset black;
	font-size: 13px;
}
table,tbody,thead,th,tr,td{
	border: 1px solid gray;
	border-spacing: 0;
	will-change: display;
}
th,td{
	padding-inline: 0.2ex;
	border-top: none;
	border-left: none;
	font-family: monospace;
}
tbody{
	padding: 2px;
}
tbody>tr:first-child>*,
tbody>tr:nth-child(1 of tr:not(.hidden))>*{
	border-top: var(--tbodyborder);
}
tbody>tr:last-child>*{
	border-bottom: var(--tbodyborder);
}
tbody>tr>*:first-child:not(.Cropping){
	border-left: var(--tbodyborder);
}
tbody>tr>*:last-child:not(.GlyphBounds),
tbody.hideKerningData>tr>*.GlyphBounds:not(:has(~.GlyphBounds)),
tbody.hideKerningData.hideGlyphBounds>tr>*.Cropping:not(:has(~.Cropping)),
tbody.hideKerningData.hideGlyphBounds.hideCropping>tr>*.Preview:not(:has(~.Preview)),
tbody.hideKerningData.hideGlyphBounds.hideCropping.hidePreview>tr>*:first-child
{
	border-right: var(--tbodyborder) !important;
}
/*#maindata.hidePreview>tr>*.Preview {
	display: none;
}
#maindata.hideCropping>tr>*.Cropping {
	display: none;
}
#maindata.hideGlyphBounds>tr>*.GlyphBounds {
	display: none;
}
#maindata.hideKerningData>tr>*.KerningData {
	display: none;
}*/

#maindata>tr>*:first-child.Cropping,
#maindata>tr>*:not(.Preview)+.Preview,
#maindata>tr>*:not(.Cropping)+.Cropping,
#maindata>tr>*:not(.GlyphBounds)+.GlyphBounds,
#maindata>tr>*:not(.KerningData)+.KerningData
{
	border-left: var(--tbodyinnerlightborder);
}
#maindata>tr>*:first-child:not(.Cropping),
#maindata>tr>*.Preview:not(:has(+.Preview)),
#maindata>tr>*.Cropping:not(:has(+.Cropping)),
#maindata>tr>*.GlyphBounds:not(:has(+.GlyphBounds)),
#maindata>tr>*.KerningData:not(:has(+.KerningData))
{
	border-right: var(--tbodyinnerlightborder);
}
#maindata.hidePreview>tr>*:first-child.Cropping,
#maindata>tr>*:not(.Preview)+.Preview,
#maindata.hidePreview>tr>*:not(.Cropping)+.Cropping,
#maindata.hidePreview.hideCropping>tr>*:not(.GlyphBounds)+.GlyphBounds,
#maindata.hidePreview.hideCropping.hideGlyphBounds>tr>*:not(.KerningData)+.KerningData
{
	border-left: var(--tbodyinnerheavyborder);
}
#maindata:not(.hidePreview)>tr>*:first-child:not(.Cropping),
#maindata.hideKerningData.hideGlyphBounds.hideCropping>tr>*.Preview:not(:has(+.Preview)),
#maindata.hideKerningData.hideGlyphBounds>tr>*.Cropping:not(:has(+.Cropping)),
#maindata.hideKerningData>tr>*.GlyphBounds:not(:has(+.GlyphBounds)),
#maindata>tr>*.KerningData:not(:has(+.KerningData))
{
	border-right: var(--tbodyinnerheavyborder);
}
#maindata>tr>th[rowspan="2"], #maindata>tr>th:not([colspan]){
	border-bottom: var(--tbodyinnerlightborder);
}
#maindata>tr:nth-child(3)>*{
	border-top: var(--tbodyinnerlightborder);
}
td{
	font-family: monospace;
}
td[data-code-point]{
	padding: 0.1lh 0.55ex;
}
td[data-code-point]>span{
	line-height: 1lh;
	white-space: pre;
}
td[data-code-point]>span~span{
	padding-inline-start: 1em;
	white-space: wrap;
}
td:first-child {
	width: 20em;
	max-width: 20em;
}
td.Preview {
	background-color: black;
	padding: 2px;
	vertical-align: top;
}
.boundbox{
	outline: 1px solid #F007;
	outline-offset: 0.1px;
}
.kernbox{
	outline: 1px solid #E507;
	outline-offset: 0.1px;
}
.glyphbox, a.glyphbox {
	outline: 1px solid #FF07;
	outline-offset: 0.1px;
}
a.glyphbox {
	outline-color: color-mix(in srgb, transparent 25%, LinkText);
}
td.Preview>div{
	transform-origin: top left;
}
img {
	image-rendering: pixelated;
	image-rendering: crisp-edges;
}
[data-fontname^="chinese"] img,
[data-fontname^="japanese"] img,
[data-fontname^="korean"] img{
	image-rendering: auto;
	image-rendering: smooth;
}
.CharRaw.hidden~br:has(~.CharCat.hidden),
.CharRaw.hidden~.CharCode.hidden~br,
br:has(~.CharName.hidden~.CharCat.hidden),
.CharCode.hidden~br:has(~.CharName.hidden) {
	display: none;
}

*:target {
	outline: 5px solid highlight;
}
.GlyphLocationCutout .boundbox {
	background-color: white;
	outline: none !important;
}

#workingbox {
	cursor: wait;
	position: fixed;
	height: 100vh;
	width: 100vw;
	vertical-align: middle;
	display: block;
	top: 0;
	left: 0;
	right: 0;
	bottom: 0;
	text-align: center;
	line-height: 100vh;
	font-size: larger;
	font-size: 4em;
	font-size: 4lh;
	font-size: 4rlh;
	background-color: white;
	z-index: 9001;
	background-color: #FFFD;
}
</style>

};

	function dataURLtoBlob(dataurl) {
		var arr = dataurl?.split(',') ?? ["data:image/png;base64",""], mime = arr[0].match(/:(.*?);/)[1],
		bstr = atob(arr[1]), n = bstr.length, u8arr = new Uint8Array(n);
		while(n--){
			u8arr[n] = bstr.charCodeAt(n);
		}

	Object.entries(data).forEach((entry,entryindex)=>{

			"GlyphLocations": (function(){
						let prevdiv = document.createElement("span")

						entry[1].Characters.forEach(character=>{
							var ch = JSON.stringify(character.Character).slice(1,-1);
							var CharCodePoint = character.Character.codePointAt(0);
							codepoints.push(CharCodePoint);
							var CharUnicodePoint = "U+"+CharCodePoint.toString(16).toUpperCase().padStart(4,"0");
							var GlyphBounds = character.GlyphBounds;
							let boundsdiv = document.createElement("a");//can't use the image map element because we want to overlay the link box onto the image.
							boundsdiv.className = "glyphbox";
							boundsdiv.style.top = GlyphBounds.Y+"px";
							boundsdiv.style.left = GlyphBounds.X+"px";
							boundsdiv.style.width = GlyphBounds.Width+"px";
							boundsdiv.style.height = GlyphBounds.Height+"px";
							boundsdiv.style.position = "absolute";

							boundsdiv.title = CharUnicodePoint+"\n"+ch;
							prevdiv.appendChild(boundsdiv);

						imgimg.addEventListener("load",()=>{
							prevdiv.style.width = imgimg.naturalWidth*FontScale+"px";
							prevdiv.style.height = imgimg.naturalHeight*FontScale+"px";
						});
						imgimg.addEventListener("error",()=>{
							var sz = entry[1].Characters.reduce((c,e,i,a)=>[Math.max(a[i].GlyphBounds.X+a[i].GlyphBounds.Width+1,c[0]),Math.max(a[i].GlyphBounds.Y+a[i].GlyphBounds.Height+1,c[1])], [0,0]);
							imgimg.style.width = sz[0]+"px";
							imgimg.style.height = sz[1]+"px";
							prevdiv.style.width = sz[0]*FontScale+"px";
							prevdiv.style.height = sz[1]*FontScale+"px";
						});
						imgimg.style.backgroundColor = "black";
						prevdiv.style.scale = FontScale;
						prevdiv.style.transformOrigin= "top left";
						return prevdiv;
					})(),
			"CodePointRanges": (function() {
				function codePointToString(cp){
					return "0x"+cp.toString(16).toUpperCase().padStart((cp<=0xFF) ? 2 : 4,"0");
				}
				let result = [];
				const CJKCharStr = "[CJK Characters]";
				codepoints = codepoints.sort((a,b)=>a-b);
				const groupCJK = true;//TODO make this a checkbox somehow
				for(let i=0; i<codepoints.length; ++i) {
					let startRange = codepoints[i];
					let endRange = startRange;
					while (codepoints[i + 1] === endRange + 1) {
						endRange++;
						i++;
					}
					if(groupCJK && (
								startRange>=0x3000 && startRange<=0x303F //CJK Symbols and Punctuation
								|| startRange>=0x3040 && startRange<=0x309F //Hiragana
								|| startRange>=0x30A0 && startRange<=0x30FF //Katakana
								|| startRange>=0x3400 && startRange<=0x4DBF //CJK Ideograph Extension A
								|| startRange>=0x4E00 && startRange<=0x9FFF //CJK Ideograph
								|| startRange>=0xAC00 && startRange<=0xD7AF //Hangul Syllable
							)){
						if(result[result.length-1] !== CJKCharStr){
							result.push(CJKCharStr);
						}
						continue;
					}
					let cend = null;
					let cstart = document.createElement("a");
					cstart.textContent = codePointToString(startRange);
					cstart.href = "#char-"+startRange;
					if (startRange !== endRange) {
						cend = document.createElement("a");
						cend.textContent = codePointToString(endRange);
						cend.href = "#char-"+endRange;
						if(endRange-startRange>2){
							let spangroup = document.createElement("span");
							spangroup.append("[");
							spangroup.append(cstart);
							spangroup.append(" to ");
							spangroup.append(cend);
							spangroup.append("]");
							result.push(spangroup);
						}else{
							result.push(cstart);
							result.push(cend);
						}
					} else {
						result.push(cstart);
					}
					function formatText(tx){
						//return (function(sarr){
						//	return sarr[0].padEnd(sarr.at(-2).length-4," ")+" "+sarr[1]+"\n"+sarr.at(-2)+"  "+sarr.at(-1);
						//})(tx.split("\n"));
						return tx.replaceAll(/\n{2,}/g,"\n");
					}
					function tryloadchartitles(){
						var se = document.getElementById(cstart.hash.substring(1));
						var ee = cend != null ? document.getElementById(cend.hash.substring(1)) : -1;
						
						if(se == null || (ee!==-1 && ee==null)){
							window.requestAnimationFrame(tryloadchartitles);
						}else{
							let st = se.children[0].innerText;
							cstart.title = formatText(st);
							
							if(cend != null){
								let et = ee.children[0].innerText;
								cend.title = formatText(et);
							}
						}
					}
					window.requestAnimationFrame(tryloadchartitles);
				}
				let exel = document.createElement("span");
				result.forEach((e,i,a)=>{
					exel.append(e);
					if(i<(a.length-1)){
						exel.append(", ");
					}
				});
				return exel;
			})(),
			
		};
		preRowVals["SampleText"] = (function(){
						const sampleText = "The quick brown fox jumps\nover the lazy dog."
										+ "\nABCDEFGabcdefg1234567890";
						{
							let sampleDivCell = document.createElement("td");
							let sampleDiv = document.createElement("div");
							sampleDiv.style.backgroundColor = "black";
							sampleDiv.style.lineHeight = "0";
							sampleDiv.style.padding = "2px";
							let renderscale = Number(preRowVals.RenderedScale);
							let scaledfontspacing = renderscale*preRowVals.Spacing;
							let scaledfontlinespacing = renderscale*preRowVals.LineSpacing;
							window.addEventListener("load", ()=>{
								let sampleTextElems = sampleText.split("").map(c=>{
									switch(c){
										case "\n":
											return document.createElement("br");
										case "\r":
											break;
										default:{
											let chelem = tablebody.querySelector("#char-"+c.charCodeAt(0)+" [data-fontname=\""+fontname+"\"][data-headername=\"Preview\"] div").cloneNode(true);
											let bb = chelem.querySelector(".boundbox").style;
											let glyphbox = chelem.querySelector("div:not(.boundbox):not(.kernbox)");
											chelem.style.display = "inline-block";
											chelem.style.verticalAlign = "top";
											Array.from(chelem.children).forEach(a=>{
												let newscaledwidth = 0.5*a.style.outlineWidth.slice(0,-2);
												a.style.outlineWidth = newscaledwidth+"px";
												a.style.outlineOffset = newscaledwidth/-2+"px";
											});
											chelem.style.height = renderscale*bb.height;
											chelem.style.width = renderscale*bb.width;
											chelem.style.marginInlineEnd = scaledfontspacing+"px";
											if(Number(glyphbox.style.top.slice(0,-2)) > Number(bb.height.slice(0,-2))){
												glyphbox.style.display = "none";
											}
											chelem.style.transform = "translate(-"+bb.left+", -"+bb.top+")";
											chelem.style.transformOrigin = "top left";
											chelem.style.marginBlockEnd = scaledfontlinespacing+"px";
											return chelem;
										}
									}
								});
								sampleTextElems.forEach(a=>sampleDiv.appendChild(a));
							});
							return sampleDiv;
						}
					})();
		
		var hideCheckbox = document.createElement("input");
		hideCheckbox.setAttribute("type", "checkbox");
		hideCheckbox.id="checkbox_"+fontname;
		var hideCheckboxLabel = document.createElement("label");
		hideCheckboxLabel.setAttribute("for", "checkbox_"+fontname);
		hideCheckboxLabel.textContent = fontname;
		hideCheckbox.onchange = updateCheckboxes;
		
		langHideCheckboxes.appendChild(hideCheckbox);
		langHideCheckboxes.appendChild(hideCheckboxLabel);
		langHideCheckboxes.appendChild(document.createElement("br"));
		
		var thfontname = document.createElement("th"); thfontname.className="spanned"; thfontname.textContent = fontname; thfontname.setAttribute("colspan",colsPerLang); tableheadrow.appendChild(thfontname);
		
		preRowNames.forEach(prerowname=>{
			let tdPreRowCell = document.createElement("td");
			tdPreRowCell.className="spanned";
			let prerowval = preRowVals[prerowname];
			
			if((typeof({}))===(typeof(prerowval))){
				tdPreRowCell.appendChild(prerowval);
			}else{
				tdPreRowCell.textContent = prerowval;
			}
			tdPreRowCell.dataset.headername = prerowname;
			tdPreRowCell.setAttribute("colspan",colsPerLang);
			preRows[prerowname].appendChild(tdPreRowCell);
		});
		
		rowHeaders.forEach(([colName,colAttrs])=>{
			var thColName = document.createElement("th");
			thColName.textContent = colName;
			thColName.setAttribute("colspan",colAttrs.length);
			tablebodyheadrow.appendChild(thColName);
			
			if(colAttrs[0]==null)
			{
				thColName.setAttribute("rowspan",2);
			}
			else
			{
				colAttrs.forEach(a=>{
					var thA = document.createElement("th");
					thA.textContent = a;
					tablebodyheadrow2.appendChild(thA);
				});
			}
		});
		
		entry[1].Characters.forEach(character=>{
			var ch = JSON.stringify(character.Character).slice(1,-1);
			var CharCodePoint = character.Character.codePointAt(0)
			var Cropping = character.Cropping;
			var GlyphBounds = character.GlyphBounds;
			var KerningData = character.KerningData;
			
			var tablerow;
			tablerow = tablerows[charrowmap.get(CharCodePoint)];
			tablerow ??= document.createElement("tr");
			if(tablerow.children.length===0){
				
				let tdCharacter = document.createElement("td");
				tdCharacter.dataset.codePoint = CharCodePoint;
				charrowmap.set(CharCodePoint, tablerows.length);
				
				
				let tdCharacterSpanRaw = document.createElement("span");
				tdCharacterSpanRaw.className = "CharRaw";
				tdCharacterSpanRaw.textContent = ch;
				tdCharacterSpanRaw.lang = NOLANG;
				tdCharacter.appendChild(tdCharacterSpanRaw);
				
				let tdCharacterSpanCodePoint = document.createElement("span");
				tdCharacterSpanCodePoint.className = "CharCode";
				tdCharacterSpanCodePoint.textContent = "U+"+CharCodePoint.toString(16).toUpperCase().padStart(4,"0");
				tdCharacterSpanCodePoint.lang = NOLANG;
				tdCharacter.appendChild(tdCharacterSpanCodePoint);
				
				let tdCharacterSpanName = document.createElement("span");
				tdCharacterSpanName.className = "CharName";
				tdCharacterSpanName.textContent = GetUnicodeData(CharCodePoint)?.Name.toLowerCase() ?? "";
				tdCharacter.appendChild(tdCharacterSpanName);
				
				tablerow.id = "char-"+CharCodePoint;
				tablerow.appendChild(tdCharacter);
			}
			while((tablerow.children.length-1)/colsPerLang<entryindex){
				for(let i = 0;i<colsPerLang;++i){
					tablerow.appendChild(document.createElement("td"));
				}
			}
			
			rowHeaders.forEach(([colName,colAttrs])=>{
				if(colName==="Preview"){
					let tdPreview = document.createElement("td");
					let prevdiv = document.createElement("div")
					let imgdiv = document.createElement("div")
					let boundsdiv = document.createElement("div")
					let kerndiv = document.createElement("div")
					imgdiv.style.overflow = "hidden";
					imgdiv.classList.add("glyphbox");
					imgdiv.style.height = GlyphBounds.Height+"px";
					imgdiv.style.width = GlyphBounds.Width+"px";
					imgdiv.style.position = "absolute";
					imgdiv.style.top = Cropping.Y+"px";
					imgdiv.style.left = Cropping.X+"px";
					imgdiv.style.outlineWidth = (1/FontScale)+"px";
					prevdiv.style.position = "relative";
					let imgimg = fontimage.cloneNode();
					imgimg.style.marginLeft = -GlyphBounds.X+"px";
					imgimg.style.marginTop = -GlyphBounds.Y+"px";
					imgimg.style.top = "0px";
					imgimg.style.left = "0px";
					imgimg.style.position = "absolute";
					imgdiv.appendChild(imgimg);
					boundsdiv.className = "boundbox";
					boundsdiv.style.top = "0px";
					boundsdiv.style.left = Cropping.X+"px";
					boundsdiv.style.width = Cropping.Width+"px";
					boundsdiv.style.height = Cropping.Height+"px";
					boundsdiv.style.position = "absolute";
					boundsdiv.style.outlineWidth = (1/FontScale)+"px";
					kerndiv.className = "kernbox";
					kerndiv.style.top = "0px";
					kerndiv.style.left = Cropping.X-KerningData[0]+"px";
					kerndiv.style.width = KerningData[1]+KerningData[2]+"px";
					kerndiv.style.height = Cropping.Height+"px";
					kerndiv.style.position = "absolute";
					kerndiv.style.outlineWidth = (1/FontScale)+"px";
					prevdiv.style.width = Math.max(Cropping.Width, Cropping.X+GlyphBounds.Width)*FontScale+"px";
					prevdiv.style.height = Math.max(Cropping.Height, Cropping.Y+GlyphBounds.Height)*FontScale+"px";

					prevdiv.appendChild(boundsdiv);
					prevdiv.appendChild(kerndiv);
					prevdiv.appendChild(imgdiv);
					tdPreview.appendChild(prevdiv);
					tablerow.appendChild(tdPreview);
				}
				else{

					if(colAttrs[0]==null){
						let tdA = document.createElement("td"); tdA.textContent = JSON.stringify(sourcedata); tablerow.appendChild(tdA);
					}else{
						colAttrs.forEach(a=>{
							let tdA = document.createElement("td"); tdA.textContent = sourcedata[a]; tablerow.appendChild(tdA);
						});
					}
				}
			});
			tablerows.push(tablerow);
		});
	});
	
	delete dataURLtoBlob;
	tablerows.forEach(tablerow=>{
		while((tablerow.children.length-1)/colsPerLang<Object.entries(data).length){
			for(let i = 0;i<colsPerLang;++i){
				tablerow.appendChild(document.createElement("td"));
			}
		}
	});
	delete charrowmap;//charrowmap won't be accurate after the tablerows.sort below anyways
	tablerows.sort((a,b)=>a.children[0].dataset.codePoint-b.children[0].dataset.codePoint)
	tablerows.forEach(elem=>tablebody.appendChild(elem));
	delete tablerows;//don't need this anymore
	
	function getReadCellIndex(cell){
		let aboverow = cell.parentElement.previousElementSibling;
		if(aboverow && Array.from(aboverow.children).findIndex(c=>c.rowSpan>1)<0){
			return cell.cellIndex;
		}
		var abovecelldims;
		if(aboverow){
			abovecelldims = Array.from(aboverow.children).map(c=>[c.rowSpan,c.colSpan]);
		}
		else{
			abovecelldims = new Array(cell.parentElement.childElementCount).fill([1,1]);
		}
		
		let cellindexoffset = 0;
		let abovecellindex = 0;
		for(var celldim of abovecelldims){
			if(celldim[0]>1){
				++cellindexoffset;
			}
			abovecellindex += celldim[1];
			if(cellindexoffset + cell.cellIndex < abovecellindex){
				break;
			}
		}
		for(var curcell of cell.parentElement.children){
			if(cell === curcell){
				break;
			}
			cellindexoffset += curcell.colSpan -1;
		}
		return cellindexoffset + cell.cellIndex;
	}

	Array.from(tablebody.rows).forEach((tablerow,rowindex)=>{
		Array.from(tablerow.children).forEach(tablecell=>{
			let cellindex = getReadCellIndex(tablecell);

			let relIndex = (cellindex-1)%colsPerLang;
			let colHeaderName = colHeaders[relIndex];
			tablecell.dataset.fontname = langName;
			tablecell.dataset.headername = colHeaderName;

			let langName = Object.keys(data)[Math.floor((cellindex-1)/colsPerLang)];
			tablecell.dataset.fontname = langName;
		});
	});
	tablehead.appendChild(tableheadrow)
	fonttable.appendChild(tablehead)
	
	Object.values(preRows).forEach(r=>tablebodypre.appendChild(r));
	
	fonttable.appendChild(tablebodypre)
	fonttable.appendChild(tablebody)
	document.body.appendChild(fonttable);
	
	const langHideGroupElem = document.getElementById("langHideGroups");
	Array.from(document.getElementById("langHideCheckboxes").querySelectorAll("input[type=checkbox]+label"))
			.map(a=>a.textContent.match(/[a-z]+/)[0]).filter((a,i,r)=>r.indexOf(a)===i).forEach(langGroupName=>{
		
		var hideCheckbox = document.createElement("input");
		hideCheckbox.setAttribute("type", "checkbox");
		hideCheckbox.id="groupcheckbox_"+langGroupName;
		var hideCheckboxLabel = document.createElement("label");
		hideCheckboxLabel.setAttribute("for", "groupcheckbox_"+langGroupName);
		hideCheckboxLabel.textContent = langGroupName;
		hideCheckbox.onchange = (()=>hideGroup(langGroupName));
		
		langHideGroupElem.appendChild(hideCheckbox);
		langHideGroupElem.appendChild(hideCheckboxLabel);
		langHideGroupElem.appendChild(document.createElement("br"));
	});
	
	const langHideCharDataElem = document.getElementById("langHideCharData");
	Array.from(document.querySelector("td[data-code-point]").children).map(a=>a.className).forEach(cl=>{
		if(!cl || cl.length==0){
			return;
		}
		var hideCheckbox = document.createElement("input");
		hideCheckbox.setAttribute("type", "checkbox");
		hideCheckbox.id="chardatcheckbox_"+cl;
		var hideCheckboxLabel = document.createElement("label");
		hideCheckboxLabel.setAttribute("for", "chardatcheckbox_"+cl);
		hideCheckboxLabel.textContent = cl;
		hideCheckbox.onchange = (()=>Array.from(document.getElementsByClassName(cl)).forEach(a=>{
			if(hideCheckbox.checked){
				a.style.display = "none";
				a.classList.add("hidden");
			}else{
				a.style.display = "";
				a.classList.remove("hidden");
			}
		}));
		
		langHideCharDataElem.appendChild(hideCheckbox);
		langHideCharDataElem.appendChild(hideCheckboxLabel);
		langHideCharDataElem.appendChild(document.createElement("br"));
	});
	const langHideFontDataElem = document.getElementById("langHideFontData");
	preRowNames.forEach(rowname=>{
		var hideCheckbox = document.createElement("input");
		hideCheckbox.setAttribute("type", "checkbox");
		hideCheckbox.id="chardatcheckbox_"+rowname;
		var hideCheckboxLabel = document.createElement("label");
		hideCheckboxLabel.setAttribute("for", "chardatcheckbox_"+rowname);
		hideCheckboxLabel.textContent = rowname;
		hideCheckbox.onchange = (()=>Array.from(document.querySelectorAll("tr[data-headername=\""+rowname+"\"]")).forEach(a=>{
			if(hideCheckbox.checked){
				a.style.display = "none";
				a.classList.add("hidden");
			}else{
				a.style.display = "";
				a.classList.remove("hidden");
			}
			updateCheckboxes();
		}));
		langHideFontDataElem.appendChild(hideCheckbox);
		langHideFontDataElem.appendChild(hideCheckboxLabel);
		langHideFontDataElem.appendChild(document.createElement("br"));
	});
	
	updateCheckboxes();
});

function updateCheckboxes(){
	var workingbox = document.getElementById("workingbox");
	workingbox.style.display = "";
	window.requestAnimationFrame(()=>{window.requestAnimationFrame(()=>{
	var hideblankrows = document.getElementById('hideBlankRowsCheckbox').checked;
	var showonlycommonchars = document.getElementById('showOnlyCommonChars').checked;
	
	let noPrev = document.getElementById('hidePreviewCheckbox').checked;
	let noCrop = document.getElementById('hideCroppingCheckbox').checked;
	let noGlyph = document.getElementById('hideGlyphBoundsCheckbox').checked;
	let noKern = document.getElementById('hideKerningDataCheckbox').checked;
	let fieldcheckboxes = [Number(noPrev)+Number(noCrop)*rectAttr.length,Number(noGlyph)*rectAttr.length,Number(noKern)*kernAttr.length];
	let visiblefieldcount = colsPerLang - fieldcheckboxes.reduce((a,b)=>a+=b);
	
	let maindata = document.getElementById('maindata')
	maindata.classList.toggle('hidePreview', noPrev);
	maindata.classList.toggle('hideCropping', noCrop);
	maindata.classList.toggle('hideGlyphBounds', noGlyph);
	maindata.classList.toggle('hideKerningData', noKern);
	var attrvals = {"undefined":false,"Preview":noPrev,"Cropping":noCrop,"GlyphBounds":noGlyph,"KerningData":noKern};
	
	document.querySelectorAll(".spanned").forEach(elem=>{
		elem.setAttribute("colspan", visiblefieldcount);
	});
	
	const newrowspan = (noCrop && noGlyph) ? 1 : 2;
	Array.from(maindata.children[0].children).forEach(a=>{
		if(a.hasAttribute("rowspan")){
			a.rowSpan = newrowspan;
		}
	});
	
	Object.assign(attrvals, Object.fromEntries(Array.from(document.getElementById("langHideFontData").querySelectorAll("input")).map(a=>[a.nextSibling.textContent,a.checked])));
	var hidelangcbvals = Object.fromEntries(Array.from(document.getElementById("langHideCheckboxes").querySelectorAll("*>input[type=checkbox]")).map(a=>[a.nextSibling.textContent,a.checked]));
	
	Array.from(document.getElementById("fonttable").rows).forEach(row=>{
		var allblank = true;
		var completeblank = true;
		var hasblanks = false;
		var cellindex = 0;
		Array.from(row.children).forEach((cell)=>{
			var hidden = hidelangcbvals[cell.dataset.fontname] || (attrvals[cell.dataset.headername ?? null] ?? false);
			
			cell.style.display = hidden ? "none" : "";
			//cell.style.maxHeight = hidden ? "0" : "";
			//cell.style.maxWidth = hidden ? "0" : "";
			//cell.style.height = hidden ? "0" : "";
			//cell.style.width = hidden ? "0" : "";
			//cell.style.overflow = "hidden";
			//cell.style.padding = hidden ? "0" : "";
			//cell.style.margin = hidden ? "0" : "";
			//cell.style.border = hidden ? "none" : "";
			
			if(cellindex > 1 && !hidden && cell.childNodes.length>0){
				allblank = false;
			}
			if(cellindex > 0 && !hidden && cell.childNodes.length>0){
				completeblank = false;
			}
			if(cellindex > 0 && !hidden && cell.childNodes.length==0){
				hasblanks = true;
			}
			
			if(cell.classList.contains("spanned")){
				cellindex += colsPerLang;
			}
			else{
				++cellindex;
			}
		});
		row.style.display = (completeblank || (hideblankrows && allblank) || (showonlycommonchars && hasblanks)) ? "none" : "";
	});
	
	Array.from(document.getElementById("bigsmall").querySelectorAll("*>input[type=checkbox]")).forEach(sizeselectorelem=>{
		
		var sizeselector = sizeselectorelem.id.match(/[a-z]+/)[0];
		var superbutton = document.getElementById(sizeselector+"Toggle");
		
		var cbvals = Array.from(document.getElementById("langHideCheckboxes").querySelectorAll("input[type=checkbox][id$=_"+sizeselector+"]")).map(c=>c.checked).map(Number)
		var checkedCount = cbvals.reduce((a,b)=>a+b);
		
		if (checkedCount === 0) {
			superbutton.checked = false;
			superbutton.indeterminate = false;
		} else if (checkedCount === cbvals.length) {
			superbutton.checked = true;
			superbutton.indeterminate = false;
		} else {
			superbutton.checked = false;
			superbutton.indeterminate = true;
		}
	});
	Array.from(document.getElementById("langHideGroups").querySelectorAll("*>input[type=checkbox]")).forEach(groupselectelem=>{
		
		var groupselector = groupselectelem.nextElementSibling.textContent;
		var superbutton = document.getElementById("groupcheckbox_"+groupselector);
		
		var cbvals = Array.from(document.getElementById("langHideCheckboxes").querySelectorAll("input[type=checkbox][id^=checkbox_"+groupselector+"]")).map(c=>c.checked).map(Number)
		var checkedCount = cbvals.reduce((a,b)=>a+b);
		
		if (checkedCount === 0) {
			superbutton.checked = false;
			superbutton.indeterminate = false;
		} else if (checkedCount === cbvals.length) {
			superbutton.checked = true;
			superbutton.indeterminate = false;
		} else {
			superbutton.checked = false;
			superbutton.indeterminate = true;
		}
	});
	document.getElementById("GlyphLocationCutoutToggle").onchange();
	workingbox.style.display = "none";
	})});
}
function sizeToggle(sizeselector){
	var targelems = document.getElementById("langHideCheckboxes").querySelectorAll("input[type=checkbox][id$=_"+sizeselector+"]");
	
	targelems.forEach(c=>c.checked=document.getElementById(sizeselector+"Toggle").checked);
	updateCheckboxes();
}
function hideGroup(langgroup){
	var targelems = document.getElementById("langHideCheckboxes").querySelectorAll("input[type=checkbox][id^=checkbox_"+langgroup+"]");
	
	targelems.forEach(c=>c.checked=document.getElementById("groupcheckbox_"+langgroup).checked);
	updateCheckboxes();
}
</script>
</head>
<body>
<div id="workingbox" style="display: none">
Working...
</div>
<div id="checkboxlists">
<div>
<input id="hideBlankRowsCheckbox" type="checkbox" onchange="updateCheckboxes()" checked=""/><label for="hideBlankRowsCheckbox">Hide Blank Rows</label><br />
<input id="showOnlyCommonChars" type="checkbox" onchange="updateCheckboxes()"/><label for="showOnlyCommonChars">Show Only Common Characters</label><br />
<input id="hidePreviewCheckbox" type="checkbox" onchange="updateCheckboxes()"/><label for="hidePreviewCheckbox">Hide Preview</label><br />
<input id="hideCroppingCheckbox" type="checkbox" onchange="updateCheckboxes()"/><label for="hideCroppingCheckbox">Hide Cropping</label><br />
<input id="hideGlyphBoundsCheckbox" type="checkbox" onchange="updateCheckboxes()"/><label for="hideGlyphBoundsCheckbox">Hide GlyphBounds</label><br />
<input id="hideKerningDataCheckbox" type="checkbox" onchange="updateCheckboxes()"/><label for="hideKerningDataCheckbox">Hide KerningData</label><br />
</div>
<div id="langHideCheckboxes">Hide Fonts<br /></div>
<div id="langHideGroups">Hide Languages<br /></div>
<div id="langHideFontData">Hide Font Data<br /></div>
<div id="langHideCharData">Hide Character Data<br /></div>
<div id="bigsmall">Hide Sizes<br />
<input id="bigToggle" type="checkbox" onchange="sizeToggle('big')"/><label for="bigToggle">Hide all big</label><br />
<input id="smallToggle" type="checkbox" onchange="sizeToggle('small')"/><label for="smallToggle">Hide all small</label><br />
</div>
<div>
<input id="GlyphLocationCutoutToggle" type="checkbox" onchange="document.querySelector(`tr[data-headername='GlyphLocations']`).classList.toggle('GlyphLocationCutout',this.checked)"/><label for="GlyphLocationCutoutToggle">GlyphLocation cutout</label><br />
</div>
</div>
</body>
</html>
